//def middlename = context.expand( '${DataSource#middleName}' )
//def lastname = context.expand( '${DataSource#lastName}' )
String name=  APIname+" "+firstname
return name
if(name.length()> 100){
return name.substring(0,10)
}
else{
	return name
}

